import React, { useEffect, useState } from "react";
import axios from "axios";



const Result = () => {
  axios({
    method: 'GET',
    url: 'http://localhost:8800/63a2bd007185dee476073e12',
     
  }).then(response => {
      console.log(response.data);
    }, (error) => {
    console.log(error);
  });
  return (
    <div>
      <h1>hello world</h1>
    </div>
  )
}


export default Result;
